script: |
  super -f text -I q13234.spq | sort > q13234.out

inputs:
  - name: q13234.spq
    data: |
      SELECT + 64 + + col1 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - col2 / - 71 * 7 + + col1 * + col1 + col1 BETWEEN + + col2 + + 60 * - - col2 AND NULL;
  - name: tab2

outputs:
  - name: q13234.out
    data: |
